soup = BeautifulSoup(html, 'html.parser')

historic_players = soup.find_all("a", class_="historic")
active_players = soup.find_all("a", class_="active")

def parse_url(url):
    url = url.split('/')
    return url[len(url) - 2]

player_dict = {}
for historic_link in historic_players:
    name = (' '.join(list(reversed(historic_link.contents[0].split(' ')))))
    name = name[:len(name) - 1]
    player_dict[name] = parse_url(historic_link['href'])

for active_link in active_players:
    name = (' '.join(list(reversed(active_link.contents[0].split(' ')))))
    name = name[:len(name) - 1]

    profile_link = active_link['href']
    try:
        print(name)
        profile_html = urllib.request.urlopen(profile_link)
        profile_soup = BeautifulSoup(profile_html, 'html.parser')
        id = parse_url(profile_soup.find(id='tab-stats')['href'])
        player_dict[name] = id

        time.sleep(3)

    except(ValueError):
        pass

with open("player.json", "w") as outfile:
    json.dump(player_dict, outfile, indent=4)





